import React from 'react'
import { Swiper, SwiperSlide } from 'swiper/react';

import 'swiper/css';
import "swiper/css/effect-cards";

import 'swiper/css/pagination';
import 'swiper/css/navigation';

import { EffectCards, Pagination, Navigation } from 'swiper';

const Cards = () => {

    return (
        <div>
            <Swiper
                effect={"cards"}
                grabCursor={true}
                centeredSlides={true} z
                loop={true}
                slidesPerView={'auto'}
                modules={[EffectCards, Pagination, Navigation]}
                className="swiper_container"
            >
                <SwiperSlide className='bg-white text-black'></SwiperSlide>
                <SwiperSlide className='bg-white text-black'>Slide 2</SwiperSlide>
                <SwiperSlide className='bg-white text-black'>Slide 3</SwiperSlide>

            </Swiper>
        </div>
    )
}

export default Cards
